import React from 'react';
import NomBtn from '../NomBtn/NomBtn';

function Movie({movie}) {
  return (
    <div className="movie">
      <p className="movie__text">{`${movie.Title} (${movie.Year})`}</p>
      <NomBtn nom={true} />
      <button className="btn btn--nominate">Nominate</button>
    </div>
  );
}

export default Movie;
